import './App.css';
import arrow from './arrow.png';

function App() {
	return (
		<div className="App">
			<div className="text-box">
				<div className="text-input">
					<textarea
						type="text"
						className="input"
						placeholder="Type something..."
					></textarea>
					<img src={arrow} className="arrow"></img>
					<input
						type="text"
						className="output"
						placeholder="Response..."
					></input>
				</div>
			</div>
		</div>
	);
}

export default App;
